import React, { Component } from 'react';
import { Container, Jumbotron,Row,Col,Card } from 'reactstrap';
import { Media,CardBody,CardImg,CardTitle,CardText,CardSubtitle,Button } from 'reactstrap';

class Profile extends Component {
    constructor(props){
        super(props);
    }

    
  render()
   {
    return (
      <Jumbotron>
        <Media>
         <Container >
          <div class="media">
          <Row class="mt=5">
           <img class="align-self-center ml-3" data-src="data:image/jpeg;base64," alt="Avatar"class="rounded-circle"></img>
          
          </Row>
          </div>
         </Container>
         <Container >
          <Row>

           <div class="w-50 p-3">
            
             <h2 class="ml=5">Username</h2>
           </div>
          </Row>
         </Container>
        </Media>  
       
        <Container >
         <div>
          <Card>
           <CardImg top width="100%" src="/assets/318x180.svg" alt="Poster" />
           <CardBody>
            <CardTitle tag="h5">Movie Name</CardTitle>
            <CardSubtitle tag="h6" className="mb-2 text-muted">Details</CardSubtitle>
            <CardText>Review for that movie</CardText>
            </CardBody>
          </Card>
         </div>
          </Container>
      </Jumbotron>
    );
   };
}

export default Profile
